style.css:
@-moz-document domain("trello.com") {
body {
  background: #222222;
  color: #CCCCCC !important;
}

.board-name, .ed {
  color: #CCCCCC !important;
}

.board-canvas {
  background: #0F3c5e !important;
}

.list {
  background: #222222;
}

.list-card-details {
  background: #333333;
  color: #CCCCCC !important
}

.clearfix {
  color: #CCCCCC !important;
}

.list-card-title {
  color: #CCCCCC !important;
}

.board-widgets {
  background: #222222;
}
    
.board-widget-activity {
  background: #333333;
}
      
.action-comment {
  background: #444444;
}
        
.inline-object {
  color: #CCCCCC;
}
}
